import React from 'react';

function List() {
  const review = [
    { id: 1, text: 'reviewer1: This is good' },
    { id: 2, text: 'reviewer2: This is very good' }
  ];
  const reviews = review.map((r) => <li key={r.id}>{r.text}</li>);

  return (
    <div>
      <ul>{reviews}</ul>
    </div>
  );
}

export default List;
